const actionsToExpress = actions => Object
  .keys(actions)
  .map(action => ({
    [action]: (req, res) => {
      try {
        const { query, body } = req
        const params = { ...query, ...body }
        return res
          .status(201)
          .json(actions[action].call(this, { params }))
      } catch (error) {
        return res
          .status(500)
          .json({ error: JSON.stringify(error) })
      }
    }
  }))
  .reduce((p, c) => ({ ...p, ...c }))

class Microservice {
  constructor ({ repository, logger, request, services }) {
    this.repository = repository
    this.actions = { set: actionsToExpress }
    this.params = params
    this.logger = logger
    this.services = services
    this.request = request
  }
}

